import React, { Component } from 'react';
import Grid from '@material-ui/core/Grid';
import axios from 'axios';
import Post from '../components/Post';
import Profile from '../components/Profile.js';


class home extends Component {
    constructor(props) {
        super(props);
    
        this.state = {
            posts: [],
            post1: null
        };
    }
    
    componentDidMount(){
        axios
    .get('https://cors-anywhere.herokuapp.com/https://us-central1-socialapp-35d2e.cloudfunctions.net/api/posts', {
        headers: {
          'Access-Control-Allow-Origin': true,
        },
        })
    .then((res) => { 
      this.setState({posts: res.data});
    });
}
    
    
    render() {
        var posts;
        var recentPosts;
        posts = this.state.posts;

        if(posts != null){
            recentPosts = posts.map((post) => <Post key={post.postId} post={post}/>);
        }

        return (
            <div>
                <Grid container>
                    <Grid item md={5}>
                        {recentPosts}
                    </Grid>
                    <Grid item md={5}>
                        {recentPosts}
                    </Grid>
                    <Grid item md={2}>
                        <Profile></Profile>
                    </Grid>
                </Grid>

            </div>
        )
    }
}

export default home;
